import './Tables.scss';
import { Row } from './Row';

import schedule from '../../data/Schedule.json';

export const Tables = () => {
  return (
      <div className="tables">
        <thead className='thead'>
            <tr>
            <th className='thead-th'> </th>
            <th className='thead-th'>Monday</th>
            <th className='thead-th'>Tuesday</th>
            <th className='thead-th'>Wednesday</th>
            <th className='thead-th'>Thursday</th>
            <th className='thead-th'>Friday</th>
            <th className='thead-th'>Saturday</th>
            <th className='thead-th'>Sunday</th>

            </tr>
        </thead>
        <tbody>
           {schedule.map(id => (
            <>
            <Row
                time = {schedule.time.map(time => (
                    time.time
                ))}
                planForMonday = {schedule.plan}
            />
            </>
           ))}
        </tbody>
      </div>
  );
}
